package contracts

import (
	"github.com/ethereum/go-ethereum/common"
	"github.com/ethereum/go-ethereum/common/hexutil"
)

var (
	NodeDriverBytecode         = hexutil.MustDecode("")
	NodeDriverAuthBytecode     = hexutil.MustDecode("")
	StakingBytecode            = hexutil.MustDecode("")
	ValidatorInfoBytecode      = hexutil.MustDecode("")
	NetworkInitializerBytecode = hexutil.MustDecode("")
)

var (
	ZeroAddress                            = common.Address{}
	NetworkInitializerSmartContractAddress = common.BytesToAddress([]byte{0x01, 0x00})
	EvmWriterSmartContractAddress          = common.BytesToAddress([]byte{0x01, 0x01})
	NodeDriverSmartContractAddress         = common.BytesToAddress([]byte{0x01, 0x02})
	NodeDriverAuthSmartContractAddress     = common.BytesToAddress([]byte{0x01, 0x03})
	StakingSmartContractAddress            = common.BytesToAddress([]byte{0x01, 0x04})
	ValidatorInfoSmartContractAddress      = common.BytesToAddress([]byte{0x01, 0x05})
)

func IsSystemContract(address common.Address) bool {
	return address == NetworkInitializerSmartContractAddress ||
		address == NodeDriverSmartContractAddress ||
		address == NodeDriverAuthSmartContractAddress ||
		address == EvmWriterSmartContractAddress ||
		address == StakingSmartContractAddress ||
		address == ValidatorInfoSmartContractAddress
}
